import React from "react";
import styled from "styled-components";

const Container = styled.div`
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background: require(./main.jpg);
  background-size: cover;
`;

const Bodypart = () => {
  return(
  <Container></Container>
  );
}

export default Bodypart;
